import Item from './Item'

export default function Items({items, onAdd, onShowItem}) {
  return (
    <main>

      {items.map((el => (
        <Item 
        key={el.id} onShowItem={onShowItem} data={el} onAdd={onAdd}/>
      )))}
    </main>
  )
}
